"use strict";(self.webpackChunkdg_knowlege_base=self.webpackChunkdg_knowlege_base||[]).push([[7361],{5104:e=>{e.exports=JSON.parse('{"tag":{"label":"Connector","permalink":"/datagol-knowlegde-base-v1/docs/tags/connector","allTagsPath":"/datagol-knowlegde-base-v1/docs/tags","count":14,"items":[{"id":"Lakehouse/Orchestrations/Adding members to an orchestration","title":"Adding members to an orchestration","description":"You can add users to an orchestration. If they do not already have access to associated pipelines, they can be granted permissions. Only Lakehouse members can be added, and they will receive creator permissions by default.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Adding members to an orchestration"},{"id":"Lakehouse/Orchestrations/Creating Orchestrations","title":"Creating Orchestrations","description":"Orchestration in DataGOL allows you to define and manage the execution order of multiple pipelines. This is crucial when you have dependencies between pipelines, where one pipeline needs to complete successfully before another can begin. Without orchestration, scheduling pipelines to run independently might lead to failures or unexpected results if a dependent pipeline runs before its required data is ready.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Creating Orchestrations"},{"id":"Lakehouse/Datasources","title":"Datasources","description":"From the Data Source section you can connect to a wide range of data platforms. This module supports integration with popular services such as MySQL, MS SQL Server, DB2, and Postgres databases through a user-friendly authentication and authorization workflow.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Datasources"},{"id":"Lakehouse/Orchestrations/Deleting an orchestration","title":"Deleting an orchestration","description":"1.  On the DataGOL Home page, from the left navigation panel, click Lakehouse > Orchestration.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Deleting an orchestration"},{"id":"Lakehouse/Orchestrations/Editing an Orchestration","title":"Editing an Orchestration","description":"1.  On the DataGOL Home page, from the left navigation panel, click Lakehouse > Orchestration.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Editing an Orchestration"},{"id":"Lakehouse/Jobs","title":"Jobs","description":"Navigate to Jobs: Under the Lakehouse section, go to Jobs. This section provides a consolidated list of upcoming jobs Scheduled, Failed and Running as per the filter selected for all pipelines created in the platform.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Jobs"},{"id":"Lakehouse/Orchestrations/Managing Orchestrations","title":"Managing Orchestrations","description":"You can manage and monitor the orchestrations from the Orchestrations page. The main Orchestration page display a list of all created orchestrations.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Managing Orchestrations"},{"id":"Lakehouse/Data Pipeline/Pipelines","title":"Pipelines","description":"Data pipeline is a structured workflow that facilitates the movement and transformation of data from various data sources into your central warehouse and also in another data source. A pipeline can be compared to a conveyor belt that picks up data, performs specific actions on it, and then deposits it in its designated location.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Data Pipeline/Pipelines"},{"id":"Lakehouse/Orchestrations/Running an orchestration","title":"Running an orchestration","description":"1.  On the DataGOL Home page, from the left navigation panel, click Lakehouse > Orchestration. The list of created orchestrations is displayed.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Running an orchestration"},{"id":"Lakehouse/Schema change detection","title":"Schema change detection","description":"Schema Change Detection","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Schema change detection"},{"id":"Lakehouse/Orchestrations/Updating the orchestration settings","title":"Updating the orchestration settings","description":"1.  On the DataGOL Home page, from the left navigation panel, click Lakehouse > Orchestration.","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Updating the orchestration settings"},{"id":"Lakehouse/Orchestrations/Viewing pipeline details of an orchestration","title":"Viewing pipeline details of an orchestration","description":"Viewing pipeline details of an orchestration","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Viewing pipeline details of an orchestration"},{"id":"Lakehouse/Orchestrations/Viewing the orchestration graph","title":"Viewing the orchestration graph","description":"The Graphs tab within an orchestration provides a clear visual representation of the pipeline\'s execution order, illustrating the sequence of stages. To view the orchestration graph do the following:","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Viewing the orchestration graph"},{"id":"Lakehouse/Orchestrations/Viewing the orchestration run details","title":"Viewing the orchestration run details","description":"Viewing the orchestration run details","permalink":"/datagol-knowlegde-base-v1/docs/Lakehouse/Orchestrations/Viewing the orchestration run details"}],"unlisted":false}}')}}]);